var queryURL = "https://icanhazdadjoke.com/slack";

export default {
    // get all posts
    search:  () =>  {
        // for some reason the slack api link works best

        for (var i = 0; i < 5; i++) {
            console.log("about to fetch")
            fetch(
                queryURL,
                {
                    method: "GET",
                }
            ).then(res=>{
                return res.attachments[0].text
            })
        }


    }
}
